import React, { useState } from 'react'
import './sidebar.css';
import { useNavigate } from 'react-router-dom';
// import {
//   BrowserRouter as Router,
//   Routes,
//   Route,
// } from "react-router-dom";


function SideBar() {
    const [isOpen, setIsOpen] = useState(true);
    const navigate = useNavigate();

  return (
    <div className="sidebar">
        {/* <button onClick={()=> setIsOpen(!isOpen)} className='toggle'>
            {isOpen?'<':'>'}
        </button> */}
        <div className="menu">
            <a onClick={()=>navigate('/account_details')} href=''>Dashboard</a>
            <a onClick={()=>navigate('/deposite')} href=''>Deposit</a>
            <a onClick={()=>navigate('/withdraw')} href=''>Withdraw</a>
            <a onClick={()=>navigate('/transfer')} href=''>Transfer</a>
        </div>
    </div>
  )
}

export default SideBar
